SELECT * FROM car_makers O_car_makers WHERE (O_car_makers.Id > (SELECT MIN(I_car_makers.Id) FROM car_makers I_car_makers) AND O_car_makers.FullName IN "('Subaru','Kia Motors','Daimler Benz','Opel','Toyota')")
SELECT O_cars_data.Accelerate FROM car_names O_car_names JOIN cars_data O_cars_data JOIN model_list O_model_list ON O_car_names.MakeId=O_cars_data.Id AND O_model_list.Model=O_car_names.Model WHERE (O_model_list.ModelId < 7.0 AND O_car_names.MakeId > (SELECT AVG(I_car_names.MakeId) FROM car_names I_car_names))
SELECT O_countries.CountryId, O_countries.CountryName FROM countries O_countries WHERE O_countries.Continent < (SELECT AVG(I_countries.Continent) FROM car_makers I_car_makers JOIN countries I_countries ON I_countries.CountryId=I_car_makers.Country WHERE (I_car_makers.Id != 5.0 AND (I_countries.Continent != 3.0 OR I_countries.Continent = 1.0)))
SELECT * FROM countries O_countries WHERE O_countries.CountryId >= (SELECT AVG(I_countries.CountryId) FROM countries I_countries WHERE (I_countries.CountryName != "mexico" OR (I_countries.Continent != 3.0 AND I_countries.Continent = 1.0)))
SELECT O_car_makers.Id, O_model_list.Model FROM car_makers O_car_makers JOIN model_list O_model_list ON O_car_makers.Id=O_model_list.Maker WHERE (O_car_makers.FullName LIKE "%kswagen" OR O_model_list.Maker <= (SELECT MAX(I_model_list.Maker) FROM car_names I_car_names JOIN model_list I_model_list ON I_model_list.Model=I_car_names.Model WHERE I_car_names.Model != "renault"))
SELECT O_car_names.Make, O_car_names.MakeId FROM car_names O_car_names JOIN model_list O_model_list ON O_model_list.Model=O_car_names.Model WHERE ((O_car_names.MakeId = 157.0 OR O_model_list.Maker > (SELECT AVG(I_model_list.Maker) FROM car_names I_car_names JOIN cars_data I_cars_data JOIN model_list I_model_list ON I_car_names.MakeId=I_cars_data.Id AND I_model_list.Model=I_car_names.Model WHERE (I_model_list.Maker != 2.0 OR I_cars_data.Id != 100.0))) OR O_car_names.Make NOT LIKE "%marquis%")
SELECT O_car_makers.Id FROM car_makers O_car_makers JOIN continents O_continents JOIN countries O_countries ON O_continents.ContId=O_countries.Continent AND O_countries.CountryId=O_car_makers.Country WHERE (O_continents.ContId <= (SELECT MAX(I_continents.ContId) FROM car_makers I_car_makers JOIN continents I_continents JOIN countries I_countries ON I_continents.ContId=I_countries.Continent AND I_countries.CountryId=I_car_makers.Country WHERE I_car_makers.Country != 4.0) OR O_car_makers.Country != 1.0)
SELECT O_car_makers.Id FROM car_makers O_car_makers WHERE (O_car_makers.Country = (SELECT AVG(I_car_makers.Country) FROM car_makers I_car_makers WHERE (I_car_makers.Id = 18.0 OR I_car_makers.Id != 6.0)) AND O_car_makers.Maker NOT IN "('renault','toyota','saab')")
SELECT O_countries.Continent, O_countries.CountryId FROM car_makers O_car_makers JOIN countries O_countries ON O_countries.CountryId=O_car_makers.Country WHERE (O_car_makers.Id != 6.0 OR O_car_makers.Id >= (SELECT SUM(I_car_makers.Id) FROM car_makers I_car_makers))
SELECT O_car_names.Model FROM car_names O_car_names WHERE (O_car_names.MakeId > (SELECT MIN(I_car_names.MakeId) FROM car_names I_car_names) AND O_car_names.MakeId = 380.0)
